  assemblies:
  - Vortex.Connector
  namespace: Vortex.Connector.Attributes
  summary: "\nPrevents vortex builder to create a member for specific group of output type (Shadow, Plain, Onliner).\n<div class=\"NOTE\"><h5>note</h5><p>This attribute must be declared in the PLC code to be effective during build process.</p></div>\n<example>\nThis example demonstrates how to prevent the vortex builder to compile specific property into specific output group.\n<pre><code>    // This will not compile to &apos;omitsInPlainString&apos; member into respective &apos;Plain&apos; type.\n    {attribute clr [CompilerOmits(CompilerOmissionGroups.BuilderPlainer))]} \n    ommitsInPlainString : STRING(50) := &apos;THIS IS OMMITED IN PLAINER&apos;;     \n    // This will not compile to &apos;ommitsInPlainAndShadowerInterfaceString&apos; member into respective &apos;Plain&apos; type and Shadow interface.\n    {attribute clr [CompilerOmits(CompilerOmissionGroups.BuilderPlainer, CompilerOmissionGroups.BuilderShadowerInterface))]} \n    ommitsInPlainAndShadowerInterfaceString : STRING(50) := &apos;THIS IS OMMITED IN PLAINER&apos;;     </code></pre>\n</example>\n"
  example: []
  syntax:
    content: >-
      [AttributeUsage(AttributeTargets.Property)]

      public class CompilerOmitsAttribute : Attribute
    content.vb: >-
      <AttributeUsage(AttributeTargets.Property)>

      Public Class CompilerOmitsAttribute
          Inherits Attribute
